import React, { Component } from 'react';

import './Login.css';

import { Button } from 'react-bootstrap';

export default class Login extends Component {
	render() {
		return (
			<div className="col-md-6 mb-3">
				<Button
					onClick={() => null}
					style={{
						backgroundColor: 'rgb(0, 225, 85)',
						border: 0,
						fontWeight: '500'
					}}
				>
					Log In with Spotify
				</Button>
			</div>
		);
	}
}
